import React from 'react';
import { Link } from 'react-router-dom';

function InfoPage() {
  return (
    <div className="bg-gradient-to-r from-pink-100 to-blue-100 min-h-screen p-8">
      <header className="flex justify-between items-center py-4">
        <div className="flex items-center space-x-2">
          <img src="./finallogos.png" alt="FailToFly Logo" className="w-10 h-10 rounded-full" />
          <span className="text-xl font-bold">FailToFly</span>
        </div>
        <nav className="space-x-4">
          <Link to="/" className="text-zinc-700 hover:text-zinc-900">Home</Link>
          <Link to="/services" className="text-zinc-700 hover:text-zinc-900">Services</Link>
          <Link to="/influencers" className="text-zinc-700 hover:text-zinc-900">Influencers</Link>
          <Link to="/contact" className="text-zinc-700 hover:text-zinc-900">Contact</Link>
        </nav>
        <Link to="/signin">
          <button className="bg-blue-100 text-blue-700 px-4 py-2 rounded-lg hover:bg-blue-200">Login</button>
        </Link>
      </header>
      <main className="mt-12">
        <section className="text-center">
          <div className="relative inline-block">
            <img src="https://placehold.co/300x400" alt="Influencer 1" className="rounded-lg shadow-lg" />
            <div className="absolute -top-4 -left-4 w-16 h-16 bg-red-500 rounded-full"></div>
            <div className="absolute -bottom-4 -right-4 w-16 h-16 bg-blue-500 rounded-full"></div>
          </div>
          <h1 className="text-5xl font-bold mt-8">Influencers Are Dreamers.</h1>
          <p className="text-zinc-700 mt-4">Influencers have specialized knowledge, authority, or insight into a specific subject. Their pre-existing presence in a niche makes them...</p>
          <Link to="/signin">
          <button className="bg-blue-100 text-blue-700 px-4 py-2 rounded-lg hover:bg-blue-200">Login</button>
        </Link>
        </section>
        <section className="mt-16 grid grid-cols-1 md:grid-cols-2 gap-8">
          <div className="relative">
            <img src="https://placehold.co/200x200" alt="Influencer 2" className="rounded-full shadow-lg" />
            <div className="absolute -top-4 -left-4 w-12 h-12 bg-green-500 rounded-full"></div>
            <div className="absolute -bottom-4 -right-4 w-12 h-12 bg-purple-500 rounded-full"></div>
          </div>
          {/* Add other influencer divs here */}
        </section>
        <section className="mt-16 text-center">
          <h2 className="text-3xl font-bold">Creativity and Problem-Solving</h2>
          <p className="text-zinc-700 mt-4">Influencers have specialized knowledge, authority, or insight into a specific subject. Their pre-existing presence in a niche makes them...</p>
          <ul className="text-left mt-8 space-y-2 mx-auto max-w-md">
            <li className="flex items-center"><span className="bg-green-500 w-4 h-4 rounded-full inline-block mr-2"></span> Promote Your Product</li>
            <li className="flex items-center"><span className="bg-blue-500 w-4 h-4 rounded-full inline-block mr-2"></span> Growing Businesses</li>
            <li className="flex items-center"><span className="bg-purple-500 w-4 h-4 rounded-full inline-block mr-2"></span> Best Clients Satisfaction</li>
          </ul>
        </section>
      </main>
      <footer className="mt-16 py-8 bg-zinc-800 text-white text-center">
        <div className="container mx-auto">
          <p>&copy; 2023 FailToFly. All rights reserved.</p>
          <nav className="mt-4 space-x-4">
            <Link to="/privacy" className="text-zinc-400 hover:text-white">Privacy Policy</Link>
            <Link to="/terms" className="text-zinc-400 hover:text-white">Terms of Service</Link>
            <Link to="/contact" className="text-zinc-400 hover:text-white">Contact Us</Link>
          </nav>
        </div>
      </footer>
    </div>
  );
}

export default InfoPage;
